describe("zoom (method)",()=>{it("should be zoomed",e=>{const t=window.createImage(),o=new Cropper(t,{ready(){const t=o.getCanvasData(),a=o.zoom(.1).getCanvasData();expect(a.width).to.be.above(t.width),expect(a.height).to.be.above(t.height),e()}})}),it("should not be zoomed when it is not zoomable",e=>{const t=window.createImage(),o=new Cropper(t,{zoomable:!1,ready(){const t=o.getCanvasData(),a=o.zoom(.1).getCanvasData();expect(a.width).to.equal(t.width),expect(a.height).to.equal(t.height),e()}})})});